validator-listerrors-description:
Listar fel (och varningar) som inträffat i parserhookar vilka lagts till via Validator.
Enbart listor för parserhookar som lagts till ovanför <code>listerrors</code>-taggen infogats;
placera <code>listerrors</code>-taggen vid eller nära slutet av sidan för att få med alla fel.
